import React from "react";

function Contact(){


return (<div>
    <style>
            {
                `
                .form-container {
                    padding-top: 24px;
                    max-width: 1000px;
                    margin: 0 auto;
                    text-align: center;

                    align-items: center;
                }

                input[type="text"],
                input[type="password"] {
                    width: 100%;
                    padding: 10px;
                    margin-bottom: 20px;

                }

                .row {
                    text-align: left;
                }

                .myffoter {
                    position: fixed;
                    bottom: 0px;
                }

                `
            }
        </style>

        <div className="form-container">
                <h1 style={{fontSize:40}}>Contact Us</h1>
                <br />
                <form action="action.html">
                    <br/>
                    <div className="row">
                        <label for="fname" className="form_text">First Name</label><br/>
                        <input type="text" id="fname" placeholder="Your Name"
                            className="input input-bordered input-info w-full max-w-xs"/>
                        <br/>
                        <label for="fname" className="form_text">Last Name</label><br/>
                        <input type="text" id="lname" placeholder="Your last name"
                            className="input input-bordered input-info w-full max-w-xs"/><br/>
                        <label for="email" className="form_text">Email</label><br/>
                        <input type="email" id="email" placeholder="Your e-mail address"
                            className="input input-bordered input-info w-full max-w-xs"/>
                        <br/>
                        <label for="fname" className="form_text">Your Query</label><br/>
                        <textarea type="text" id="query" placeholder="Write something"
                            className="input input-bordered input-info w-full max-w-xs"/>


                    </div>
                    <br/>
                    <div>
                        <button className="btn btn-outline" type="submit">Submit</button>
                    </div>
                </form>
                <br />

            </div>



    </div>
    )

}




export default Contact;
